INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (1, 1, 1, 5, 'Amazing Phone!', 'The camera quality is incredible and the battery lasts all day. Highly recommended!', '2024-01-20 14:30:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (2, 1, 8, 4, 'Great but expensive', 'Love the features but it''s quite pricey. Overall satisfied with the purchase.', '2024-02-10 09:15:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (3, 2, 3, 5, 'Perfect TV for movie nights', 'The picture quality is stunning. 4K content looks amazing on this screen.', '2024-01-25 16:45:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (4, 3, 2, 4, 'Comfortable and stylish', 'Great for daily runs. The cushioning is excellent and they look good too.', '2024-01-22 11:20:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (5, 3, 14, 5, 'Best running shoes ever!', 'I''ve tried many brands but these are by far the most comfortable.', '2024-02-20 13:45:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (6, 5, 4, 5, 'Baker''s dream machine', 'This mixer handles everything I throw at it. Perfect for serious baking.', '2024-02-01 10:30:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (7, 6, 8, 4, 'Great grill for BBQs', 'Cooks evenly and the side burner is very convenient. Assembly took some time.', '2024-02-15 15:20:00', false, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (8, 7, 12, 5, 'Magical collection', 'Beautiful hardcover editions. Perfect for any Harry Potter fan!', '2024-02-18 12:10:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (9, 8, 2, 4, 'Excellent programming guide', 'Very comprehensive and well-written. Great for beginners and intermediate programmers.', '2024-01-28 14:25:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (10, 9, 7, 5, 'Professional quality racket', 'The control and power are exceptional. Perfect weight and balance.', '2024-02-05 09:40:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (11, 10, 5, 4, 'Solid camping tent', 'Easy to set up and completely waterproof. Good value for the price.', '2024-02-01 16:55:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (12, 11, 1, 3, 'Decent moisturizer', 'Works okay but nothing special. Expected more from this brand.', '2024-01-25 11:15:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (13, 12, 4, 5, 'Amazing electric toothbrush', 'My teeth feel so much cleaner! The battery lasts for weeks.', '2024-02-08 08:45:00', true, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (14, 13, 8, 5, 'Kids love it!', 'Great building set with lots of creative possibilities. High quality pieces.', '2024-02-12 17:30:00', false, NULL);
INSERT INTO public.reviews (review_id, product_id, customer_id, rating, review_title, review_text, created_at, is_verified, embeddings) VALUES (15, 14, 15, 4, 'Fun portable gaming', 'Love being able to play anywhere. Battery life could be better though.', '2024-02-25 13:20:00', true, NULL);
